import youtube from '../apis/youtube';

import {
    FETCH_DEFAULT,
} from './types';


export const fetch_default = async () => async dispatch => {
    const response = await youtube.get('/search',{
        q: 'League of Legends'
    });
    dispatch({type: FETCH_DEFAULT, payload: response.data.items});
};
